import React from "react"
import { auth } from "../firebase/firebase"; // Assuming you have a firebase config file

function Home() {
    const logout = () => {
        auth.signOut().then(() => {
          localStorage.clear();
          window.location.reload();
        });
      };

    return (
        <div>
            <h1>
                Hello mấy con vợ
            </h1>
            <button onClick={logout}>Logout</button>
        </div>
    )
}

export default Home;
